import React, { Component } from "react";
import axios from "axios";
import queryString from "query-string";
export class SearchResults extends Component {
  constructor(props) {
    super(props);
    this.state = {
      searchResults: [],
      searchQuery: ""
    };
  }

  componentDidMount() {
    this.getSearchResults();
  }

  getSearchResults = () => {
    axios
      .get(
        `https://api.themoviedb.org/3/search/multi?api_key=170638d59cd41f58852a2f12564d2503&language=en-US&query=${`avengers`}&page=1&include_adult=false`
      )
      .then(data => console.log(data.data));
  };

  render() {
    const { query } = queryString.parse(this.props.location.search);
    console.log(query);
    return (
      <div className="container text-white py-4 text-center">
        <h1>Search Results for: " {query} "</h1>
      </div>
    );
  }
}

export default SearchResults;
